import React from "react";
import Card from "../Card";
import {
  WorkBg,
  WorkContainer,
  WorkContent,
  WorkFrost,
  AboutFrost2,
  CardColumn,
} from "./WorkElms";

const Work = () => {
  return (
    <WorkContainer id="work">
      <WorkFrost />
      <AboutFrost2 />
      <WorkBg>
        <WorkContent>
          <CardColumn>
            <Card>
              <CardContainer>
                <CardTop>
                  <CardDot />
                  <CardDot />
                  <CardDot />
                  <CardBar />
                </CardTop>
              </CardContainer>
            </Card>
          </CardColumn>
        </WorkContent>
      </WorkBg>
    </WorkContainer>
  );
};
export default Work;
